import FadeIn from '../fadeIn/fadeIn';
import ServiceItem from '../serviceItem/serviceItem';
import { Link } from 'react-router-dom';
import Footer from '../footer/footer';
import Icon from '../icon/icon';

const Career = (): JSX.Element => {

    return (
        <>
            <Header />
            <div className="career"><div className="career__web">
                <div className="career__webTile"></div>
                <ServiceItem classNameAdded="" title={<>Do you need help with builidng your website?</>} text={<>We build can build your website using technologies such as PHP or React.</>} />
            </div>
            </div>
            <Footer classNameAdded="" />
        </>
    );
}

export default Career;
